import React from 'react';
import { Text, View, TouchableOpacity, StyleSheet } from 'react-native';
import Color from "../Models/Color";
import { useFonts } from 'expo-font';
import { AntDesign } from '@expo/vector-icons';
import { Directions } from 'react-native-gesture-handler';

const RenderHeader = (props) => {
  return (
    <View style={Styles.headerContainer}>
      <View>
        {props.CanGoBack &&
          <TouchableOpacity onPress={() => console.log("back")}>
            <AntDesign name="back" size={24} color="black" />
          </TouchableOpacity>
        }
      </View>
      <View>
        <Text style>
          {props.title}
        </Text>
      </View>
      <View>
      <TouchableOpacity style={{flexDirection:'row'}} onPress={() => console.log("back")}>
            <Text>Logout</Text>
      <AntDesign name="logout" size={24} color="black" />
          </TouchableOpacity>
      </View>
    </View>
  );
}
const Header = (props) => {
  const [loaded] = useFonts({
    SourceSansProLight: require('../assets/fonts/SourceSansPro/SourceSansPro-Light.ttf'),
    SourceSansProRegular: require('../assets/fonts/SourceSansPro/SourceSansPro-Regular.ttf'),
    SourceSansProBold: require('../assets/fonts/SourceSansPro/SourceSansPro-Bold.ttf'),
  });



  return (
    <RenderHeader title={props.title} CanGoBack={true} />
  );
}

const Styles = StyleSheet.create({
  headerContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
    height: 60,
    backgroundColor: "#ffffff",
    padding: 15,

  },
  headerText:{
    fontSize:20,
    fontFamily:'SourceSansProBold',

  },
});

export default Header;
